// src/pages/kyc-step4.jsx
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { RiArrowLeftLine, RiCheckLine } from "react-icons/ri";
import { motion } from "framer-motion";
import ProgressBar from "../components/ProgressBar";

const PERSONAL_KEY = "dk_kyc_personal";
const DOC_KEY = "dk_kyc_docinfo";

export default function KYCStep4() {
  const navigate = useNavigate();
  const [personal, setPersonal] = useState(null);
  const [docinfo, setDocinfo] = useState(null);

  useEffect(()=> {
    try {
      const p = JSON.parse(localStorage.getItem(PERSONAL_KEY) || "{}");
      const d = JSON.parse(localStorage.getItem(DOC_KEY) || "{}");
      setPersonal(p || {});
      setDocinfo(d || {});
    } catch {
      setPersonal({});
      setDocinfo({});
    }
  }, []);

  const handleBack = () => navigate("/kyc-step3");

  const handleConfirm = async () => {
    // mark as submitted locally; in real app you'd POST final submission
    try {
      localStorage.setItem("dk_kyc_submitted_at", new Date().toISOString());
      // set KYC status so dashboard shows Completed/Started as you want
      localStorage.setItem("userKycStatus", "Completed");
      // Also keep personal info accessible
      if (personal?.form) {
        const form = personal.form;
        localStorage.setItem("userName", form.fullName || "");
      }
    } catch {}
    navigate("/kyc-step5");
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-50 to-white p-6">
      <motion.div initial={{ opacity: 0, y: 10 }} animate={{ opacity: 1, y: 0 }} transition={{ duration: 0.4 }} className="w-full max-w-lg bg-white p-8 rounded-2xl shadow-2xl border border-gray-100">
        <div className="mb-4"><ProgressBar step={4} total={5} /></div>

        <h2 className="text-2xl font-extrabold mb-3">Review & confirm your details</h2>
        <p className="text-sm text-slate-500 mb-6">Please verify the details below before submission. You can go back to edit any item.</p>

        <div className="space-y-3">
          <div className="rounded-lg border p-4">
            <div className="flex justify-between items-center">
              <div>
                <div className="font-medium">Personal details</div>
                <div className="text-sm text-slate-600">Name: <span className="font-medium">{personal?.form?.fullName || "—"}</span></div>
                <div className="text-sm text-slate-600">DOB: <span className="font-medium">{personal?.form?.dob || "—"}</span></div>
                <div className="text-sm text-slate-600">Address: <span className="font-medium">{personal?.form?.address || "—"}</span></div>
              </div>
              <div className="text-green-600"><RiCheckLine size={22} /></div>
            </div>
          </div>

          <div className="rounded-lg border p-4">
            <div className="flex justify-between items-center">
              <div>
                <div className="font-medium">Selected document</div>
                <div className="text-sm text-slate-600">{docinfo?.docType || "—"}</div>
                <div className="text-sm text-slate-400">Number: <span className="font-medium">{docinfo?.docNumber ? "********" + docinfo.docNumber.slice(-4) : "—"}</span></div>
              </div>
              <div className="text-green-600"><RiCheckLine size={22} /></div>
            </div>
          </div>

          <div className="rounded-lg border p-4 flex justify-between items-center">
            <div>
              <div className="font-medium">Uploaded file</div>
              <div className="text-sm text-slate-600">{docinfo?.uploadedFileName || "No file uploaded"}</div>
            </div>
            <div>{docinfo?.uploadedFileName ? <span className="text-green-600"><RiCheckLine size={22} /></span> : null}</div>
          </div>
        </div>

        <div className="flex gap-3 mt-6">
          <button onClick={handleBack} className="flex items-center gap-2 px-4 py-2 rounded-lg border border-slate-200 bg-white"><RiArrowLeftLine/> Back</button>
          <button onClick={handleConfirm} className="ml-auto inline-flex items-center gap-2 px-5 py-3 rounded-lg bg-green-600 text-white font-medium shadow"> Confirm & Submit </button>
        </div>
      </motion.div>
    </div>
  );
}
